import LoginForm from "../components/auth/LoginForm";
import RegisForm from "../components/auth/RegisForm";
import "./Auth.css";

const Auth = (props) => {
    return (
        <>
        <div className="body">
            <div className="avatar-side">
                <div className="logo">
                    MEETUP APP
                </div>
                <h2 className="title">Dang nhap gan day</h2>
                <small>Nhap vao anh cua ban</small>
            </div>

            <div className="form-side">
            {props.authRoute === 'login' && <LoginForm/>}
            {props.authRoute === 'register' && <RegisForm/>}
            </div>
        </div>
        <div className="footer">
            3
        </div>
        </>
    );
}

export default Auth;
